import React from 'react';
import styled from 'styled-components';
import { Accordion } from '../accordion';

const Wrapper = styled.div`
  width: 690px;
  margin: 100px auto;
  font-family: MuseoSans,sans-serif;
  list-style: none;
  h3 {
    text-align: center;
    margin-bottom: 30px;
  }
`;

export const FAQ = () => {
  return <Wrapper>
    <h3>Вопросы и ответы *</h3>
    <Accordion/>
  </Wrapper>
}
